import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className='main'>

        <div className='center'>

          <div className='menu'>
            <div className='logo'>
              <h3>Seculus Lawtech</h3>
            </div>
            <div className='item-menu'>
              <a href="#">Login</a>
            </div>
          </div>

        </div>
      </div>
    </div>
  );
}

export default App;
